<!DOCTYPE html>
<html lang="ko">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>내가 좋아하는 남친상은? - 심리테스트</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Black+Han+Sans&family=Noto+Sans+KR:wght@300;400;500;700&display=swap" rel="stylesheet">
    <style>
        :root {
            --pink-light: #FFE4EC;
            --pink-main: #FF6B9D;
            --pink-dark: #E91E63;
            --purple-light: #F3E5F5;
            --purple-main: #9C27B0;
            --yellow-accent: #FFD54F;
            --text-dark: #2D2D2D;
            --text-light: #666;
            --white: #FFFFFF;
            --shadow: 0 10px 40px rgba(233, 30, 99, 0.15);
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Noto Sans KR', sans-serif;
            background: linear-gradient(135deg, #FFE4EC 0%, #F3E5F5 50%, #E8F5E9 100%);
            min-height: 100vh;
            color: var(--text-dark);
        }

        .ad-banner {
            background: linear-gradient(90deg, #f8f8f8 0%, #fff 50%, #f8f8f8 100%);
            padding: 15px;
            text-align: center;
            border-bottom: 1px solid #eee;
            position: sticky;
            top: 0;
            z-index: 100;
        }

        .ad-banner-content {
            max-width: 728px;
            height: 90px;
            margin: 0 auto;
            background: linear-gradient(135deg, #e0e0e0 0%, #f5f5f5 100%);
            border-radius: 8px;
            display: flex;
            align-items: center;
            justify-content: center;
            color: #999;
            font-size: 14px;
            border: 2px dashed #ccc;
        }

        .container {
            max-width: 600px;
            margin: 0 auto;
            padding: 20px;
        }

        .header {
            text-align: center;
            padding: 20px 20px 10px;
        }

        .header h1 {
            font-family: 'Black Han Sans', sans-serif;
            font-size: 2.2rem;
            color: var(--pink-dark);
            margin: 10px 0;
            text-shadow: 2px 2px 0 var(--yellow-accent);
        }

        .header p {
            color: var(--text-light);
            font-size: 1rem;
        }

        .start-screen {
            background: var(--white);
            border-radius: 30px;
            padding: 30px;
            box-shadow: var(--shadow);
            text-align: center;
            margin-bottom: 30px;
        }

        .main-image {
            width: 100%;
            max-width: 350px;
            border-radius: 20px;
            margin-bottom: 20px;
        }

        .start-screen h2 {
            font-family: 'Black Han Sans', sans-serif;
            font-size: 1.5rem;
            color: var(--pink-dark);
            margin-bottom: 15px;
        }

        .start-screen p {
            color: var(--text-light);
            line-height: 1.8;
            margin-bottom: 25px;
            font-size: 0.95rem;
        }

        .start-btn {
            background: linear-gradient(135deg, var(--pink-main) 0%, var(--pink-dark) 100%);
            color: white;
            border: none;
            padding: 18px 50px;
            font-size: 1.2rem;
            font-weight: 700;
            border-radius: 50px;
            cursor: pointer;
            transition: all 0.3s ease;
            box-shadow: 0 5px 20px rgba(233, 30, 99, 0.4);
        }

        .start-btn:hover {
            transform: translateY(-3px) scale(1.05);
            box-shadow: 0 8px 30px rgba(233, 30, 99, 0.5);
        }

        .question-screen {
            display: none;
        }

        .question-card {
            background: var(--white);
            border-radius: 30px;
            padding: 35px 25px;
            box-shadow: var(--shadow);
            margin-bottom: 20px;
            animation: slideIn 0.5s ease;
        }

        @keyframes slideIn {
            from {
                opacity: 0;
                transform: translateX(50px);
            }
            to {
                opacity: 1;
                transform: translateX(0);
            }
        }

        .progress-bar {
            background: var(--pink-light);
            border-radius: 10px;
            height: 10px;
            margin-bottom: 25px;
            overflow: hidden;
        }

        .progress-fill {
            background: linear-gradient(90deg, var(--pink-main), var(--purple-main));
            height: 100%;
            border-radius: 10px;
            transition: width 0.5s ease;
        }

        .question-number {
            display: inline-block;
            background: linear-gradient(135deg, var(--pink-main), var(--purple-main));
            color: white;
            padding: 8px 20px;
            border-radius: 20px;
            font-size: 0.9rem;
            font-weight: 500;
            margin-bottom: 20px;
        }

        .question-text {
            font-size: 1.25rem;
            font-weight: 700;
            color: var(--text-dark);
            line-height: 1.6;
            margin-bottom: 25px;
        }

        .options {
            display: flex;
            flex-direction: column;
            gap: 12px;
        }

        .option-btn {
            background: var(--pink-light);
            border: 2px solid transparent;
            padding: 16px 20px;
            border-radius: 15px;
            font-size: 1rem;
            color: var(--text-dark);
            cursor: pointer;
            transition: all 0.3s ease;
            text-align: left;
        }

        .option-btn:hover {
            background: var(--white);
            border-color: var(--pink-main);
            transform: translateX(10px);
        }

        .option-btn:active {
            transform: scale(0.98);
        }

        .result-screen {
            display: none;
        }

        .result-card {
            background: var(--white);
            border-radius: 30px;
            padding: 35px 25px;
            box-shadow: var(--shadow);
            text-align: center;
            animation: popIn 0.6s ease;
        }

        @keyframes popIn {
            0% {
                opacity: 0;
                transform: scale(0.8);
            }
            50% {
                transform: scale(1.05);
            }
            100% {
                opacity: 1;
                transform: scale(1);
            }
        }

        .result-image {
            width: 100%;
            max-width: 320px;
            border-radius: 20px;
            margin-bottom: 20px;
            box-shadow: 0 5px 20px rgba(0,0,0,0.1);
        }

        .result-type {
            font-family: 'Black Han Sans', sans-serif;
            font-size: 2rem;
            color: var(--pink-dark);
            margin-bottom: 8px;
        }

        .result-subtitle {
            color: var(--purple-main);
            font-weight: 600;
            margin-bottom: 20px;
            font-size: 1.1rem;
        }

        .result-description {
            color: var(--text-dark);
            line-height: 1.9;
            margin-bottom: 25px;
            text-align: left;
            background: linear-gradient(135deg, var(--pink-light), var(--purple-light));
            padding: 20px;
            border-radius: 15px;
            font-size: 0.95rem;
        }

        .result-tags {
            display: flex;
            flex-wrap: wrap;
            gap: 10px;
            justify-content: center;
            margin-bottom: 25px;
        }

        .tag {
            background: linear-gradient(135deg, var(--pink-main), var(--purple-main));
            color: white;
            padding: 8px 16px;
            border-radius: 20px;
            font-size: 0.85rem;
            font-weight: 500;
        }

        .share-section {
            margin-top: 25px;
            padding-top: 25px;
            border-top: 2px dashed var(--pink-light);
        }

        .share-section h3 {
            color: var(--text-dark);
            margin-bottom: 15px;
            font-size: 1rem;
        }

        .share-btns {
            display: flex;
            gap: 10px;
            justify-content: center;
            flex-wrap: wrap;
        }

        .share-btn {
            padding: 12px 25px;
            border-radius: 25px;
            border: none;
            font-weight: 600;
            cursor: pointer;
            transition: all 0.3s ease;
            font-size: 0.9rem;
        }

        .share-btn.kakao {
            background: #FEE500;
            color: #3C1E1E;
        }

        .share-btn.twitter {
            background: #1DA1F2;
            color: white;
        }

        .share-btn.copy {
            background: var(--text-dark);
            color: white;
        }

        .share-btn:hover {
            transform: translateY(-2px);
            box-shadow: 0 5px 15px rgba(0,0,0,0.2);
        }

        .retry-btn {
            background: transparent;
            border: 2px solid var(--pink-main);
            color: var(--pink-main);
            padding: 15px 40px;
            border-radius: 30px;
            font-size: 1rem;
            font-weight: 600;
            cursor: pointer;
            margin-top: 20px;
            transition: all 0.3s ease;
        }

        .retry-btn:hover {
            background: var(--pink-main);
            color: white;
        }

        .side-ad {
            background: linear-gradient(135deg, #f5f5f5 0%, #fff 100%);
            border-radius: 15px;
            padding: 20px;
            margin: 20px 0;
            text-align: center;
            border: 2px dashed #ddd;
        }

        .side-ad-content {
            height: 250px;
            display: flex;
            align-items: center;
            justify-content: center;
            color: #999;
            font-size: 14px;
        }

        .footer {
            text-align: center;
            padding: 30px 20px;
            color: var(--text-light);
            font-size: 0.85rem;
        }

        @media (max-width: 480px) {
            .header h1 {
                font-size: 1.8rem;
            }
            
            .question-text {
                font-size: 1.1rem;
            }
            
            .result-type {
                font-size: 1.6rem;
            }
            
            .ad-banner-content {
                height: 60px;
            }

            .main-image, .result-image {
                max-width: 280px;
            }
        }

        .hidden {
            display: none !important;
        }
    </style>
</head>

        let currentQuestion = 0;
        let scores = { dog: 0, pig: 0, tiger: 0, cat: 0, wolf: 0 };
        let shuffledQuestions = [];

        function shuffleArray(array) {
            let shuffled = [...array];
            for (let i = shuffled.length - 1; i > 0; i--) {
                const j = Math.floor(Math.random() * (i + 1));
                [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
            }
            return shuffled;
        }

        function startTest() {
            // 질문 순서 섞기
            shuffledQuestions = shuffleArray(questions);
            // 각 질문의 옵션도 섞기
            shuffledQuestions = shuffledQuestions.map(q => ({
                ...q,
                options: shuffleArray(q.options)
            }));
            
            document.getElementById('startScreen').classList.add('hidden');
            document.getElementById('midAd1').classList.add('hidden');
            document.getElementById('questionScreen').style.display = 'block';
            showQuestion();
        }

        function showQuestion() {
            const question = shuffledQuestions[currentQuestion];
            document.getElementById('questionNumber').textContent = `Q${currentQuestion + 1} / ${shuffledQuestions.length}`;
            document.getElementById('questionText').textContent = question.text;
            document.getElementById('progressFill').style.width = `${((currentQuestion) / shuffledQuestions.length) * 100}%`;

            const optionsContainer = document.getElementById('optionsContainer');
            optionsContainer.innerHTML = '';

            question.options.forEach((option) => {
                const btn = document.createElement('button');
                btn.className = 'option-btn';
                btn.textContent = option.text;
                btn.onclick = () => selectOption(option.type);
                optionsContainer.appendChild(btn);
            });
        }

        function selectOption(type) {
            scores[type]++;
            currentQuestion++;

            if (currentQuestion < shuffledQuestions.length) {
                const card = document.querySelector('.question-card');
                card.style.opacity = '0';
                card.style.transform = 'translateX(-50px)';
                
                setTimeout(() => {
                    showQuestion();
                    card.style.opacity = '1';
                    card.style.transform = 'translateX(0)';
                }, 200);
            } else {
                showResult();
            }
        }

        function showResult() {
            document.getElementById('questionScreen').style.display = 'none';
            document.getElementById('resultScreen').style.display = 'block';

            const resultType = Object.keys(scores).reduce((a, b) => scores[a] > scores[b] ? a : b);
            const result = boyfriendTypes[resultType];

            document.getElementById('resultImage').src = result.image;
            document.getElementById('resultType').textContent = result.type;
            document.getElementById('resultSubtitle').textContent = result.subtitle;
            document.getElementById('resultDescription').textContent = result.description;

            const tagsContainer = document.getElementById('resultTags');
            tagsContainer.innerHTML = '';
            result.tags.forEach(tag => {
                const span = document.createElement('span');
                span.className = 'tag';
                span.textContent = tag;
                tagsContainer.appendChild(span);
            });
        }

        function retryTest() {
            currentQuestion = 0;
            scores = { dog: 0, pig: 0, tiger: 0, cat: 0, wolf: 0 };
            
            document.getElementById('resultScreen').style.display = 'none';
            document.getElementById('startScreen').classList.remove('hidden');
            document.getElementById('midAd1').classList.remove('hidden');
        }
